import React, {Fragment, useState, useEffect} from 'react';
import axios from 'axios';


const Sponsors = () => {
    const [data, setData] = useState([]);

    useEffect(() => {

        const fetchData = async () => {
        const result = await axios(
        "/memory_admin/controller/sponsor/sponsor_api.php",
        );

        setData(result.data);
        console.log("updated");
        };
        fetchData();
        console.log("mounted");

    }, [])
    // const handleClick = (key,e) => {  
    //   e.preventDefault();    
    //   console.log(key);  
    // }

  return (
    <Fragment> 
        <div className="informations_pratiques_all">
            <h1>PARTENAIRES </h1>
            
            <p className="titre_partenaires"> Partenaires officiels</p>
            {/* <ul className="image_reseau_sociaux_flex">
                <div className="flex_reseau_sociaux"> */}
                {data./*filter(name => name.id === 286).*/map((item, key) => (
                        <li className={"article"} key={key}>
                        <ul>
                            <li>
                                <button >
                                    <div className="titre_information_faq">{ item.titre_information_faq}</div>
                                </button>
                            </li>
                            <div className="sous_titre_et_contenu_information_faq">
                                <li>
                                    <div className="sous_titre_information_faq">{ item.sous_titre_information_faq}</div>
                                </li>
                                
                                <li>
                                    <div>{ item.contenu_information_faq}</div>
                                </li>
                            </div>
                        </ul>
                        {/* </Link> */}
                        </li>
                    // </a>
                    ))}
                {/* </div>
            </ul> */}
        </div>
    </Fragment> 
  ) 
}

export default Sponsors;
